import { Avatar, Box, Button, Card, CardActions, CardHeader, styled } from "@mui/material";

const CardProfile = styled(Card)(({ theme }) => ({
    marginLeft: 'auto',
    marginRight: 'auto',
    marginBottom: theme.spacing(2),
}));

const ProfileCard = (props) => {
    const { name } = props;
    return (
        <CardProfile>
            <CardHeader
                avatar={<Avatar src="/broken-image.jpg" />}
                title={name}
            />
            <CardActions>
                <Box sx={{ flexGrow: 1 }} />
                <Button variant="contained">Message</Button>
                <Box sx={{ flexGrow: 1 }} />
                <Button variant="contained">View Profile</Button>
                <Box sx={{ flexGrow: 1 }} />
            </CardActions>

        </CardProfile>
    );
};

export default ProfileCard;
